import React, { useState } from 'react';

const MarksEdit = ({ stuID, subName, subID, initialMarks, onCancel, onConfirm }) => {
  const [marks, setMarks] = useState(initialMarks);

  const handleMarksChange = (event) => {
    setMarks(event.target.value);
  };

  const handleCancel = () => {
    onCancel();
  };

  const handleConfirm = () => {
    onConfirm(marks);
  };

  return (
    <div>
      <div>
        <label>Stu ID:</label>
        <input type="text" value={stuID} readOnly />
      </div>
      <div>
        <label>Sub Name:</label>
        <input type="text" value={subName} readOnly />
      </div>
      <div>
        <label>Sub ID:</label>
        <input type="text" value={subID} readOnly />
      </div>
      <div>
        <label>Marks:</label>
        <input type="number" value={marks} onChange={handleMarksChange} />
      </div>
      <div>
        <button onClick={handleCancel}>Cancel</button>
        <button onClick={handleConfirm}>Confirm</button>
      </div>
    </div>
  );
};

export default MarksEdit;
